import React from "react";
import SearchBar from "./SearchBar";
import { Link, NavLink } from "react-router-dom";

const Nav = ({ onSearch }) => {
  return (
    <div>
      <SearchBar onSearch={onSearch} />
      <button>About</button>
      <button>Home</button>
    </div>
  );
};

export default Nav;
